function NewsList(){this.page=2,dateFormat=function(e){var t=new Date(e);return t.getFullYear()+"年"+(t.getMonth()+1)+"月"+t.getDate()+"日 "+t.getHours()+":"+t.getMinutes()}}NewsList.prototype.listenLoadMoreEvent=function(){var s=this,i=$("#load-more-btn");i.click(function(){blogajax.get({url:"/news/news_list/",data:{p:s.page},success:function(e){if(200===e.code){var t=e.data;if(0<t.length){var n=template("news-list",{newses:t});$(".news-list-group").append(n),s.page+=1}else i.hide()}}})})},NewsList.prototype.run=function(){this.listenLoadMoreEvent()},$(function(){(new NewsList).run()});
